import React, { useState } from "react";
import "./App.css";

function App() {
  const [count, setCount] = useState(0);
  const increment = () => {
    setCount(count + 1);
  };

  return (
    <div>
      <div onClick={increment}>{count}</div>
    </div>
  );
}

export default App;
